<script>
import axios from 'axios'
import u from "../../utilities/utility"
import db from "../../utilities/database"
import a from "../../utilities/authentication"

const SESSION_STATUS = 'ss'

export default {
  name: "Login",
  data() {
    return {
      info: {
        username: "",
        password: ""
      },
      msg: '',
      class_name: '',
      hrm_id: '',
      my_email: '',
      ready: db.l.g(SESSION_STATUS),
      loading: false,
      message: '',
      title: 'THÔNG BÁO',
      name: 'modal-primary',
      reset: false,
      modal: false
    };
  },
  created() {
    u.g('/api/get-login-redirect').then(response => {
        location.href = response
    })
    if (db.l.g(SESSION_STATUS) === null) {
      db.l.s(SESSION_STATUS, 'started')
      window.location.href = window.location.href
    }
  },
  methods: {
    keymonitor: function(event) {
       if(event.key == "Enter"){
         this.login()
       }
    },
    forgetPass() {
      // this.name = 'modal-success'
      // this.message = 'Xin vui lòng liên hệ với khối Công Nghệ để được cấp lại mật khẩu mới.';
      // this.modal = true;
      // return;
      // this.reset = true
      this.$modal.show('reset')
    },
    beforeClose() {
      this.message = ''
      this.hrm_id = ''
      this.my_email = ''
    },
    resetPassword() {
      let valid = true
      this.msg = '';
      if (this.hrm_id === '') {
        valid = false
        this.class_name = 'danger'
        this.msg += 'Vui lòng nhập mã nhân viên (HRM) của bạn.</br>'
      }
      if (this.my_email === '' || (this.my_email !== '' && this.my_email.indexOf('cmsedu.vn') === -1)) {
        valid = false
        this.class_name = 'danger'
        this.msg += 'Vui lòng nhập chính xác tài khoản email CMS của bạn để khôi phục lại mật khẩu.</br>'
      }
      if (valid) {
        this.msg = "Đang xử lý yêu cầu, xin vui lòng chờ trong giây lát..."
        this.class_name = 'success'
        axios
          .post("/api/users/reset/account/password", {email: this.my_email, hrm: this.hrm_id})
          .then(response => {
            const data = response.data.data
            if (data.success) {
              this.class_name = 'success'
              this.my_email = ''
              this.hrm_id = ''
              this.$modal.hide('reset')
              this.title = 'Thông Báo'
              this.name = 'modal-success'
              this.message = `Khôi phục mật khẩu thành công!</br>${data.message}</br>`;
              this.modal = true
            } else {
              this.class_name = 'danger'
              this.message = `Khôi phục mật khẩu thất bại.</br>${data.message}`;
              this.msg = `Khôi phục mật khẩu thất bại.</br>${data.message}`;
              this.modal = true
            }
          })
      }
    },
    login() {
      let title = "";
      let message = "";
      if (this.info.username == "" || this.info.password == "") {
        message = "Vui lòng điền thông tin đăng nhập.<br/> - Tên tài khoản không thể để trống.<br/> - Mật khẩu không thể để trống.";
      } else if (
        this.info.username.length < 2 ||
        this.info.password.length < 6
      ) {
        message = "Thông tin đăng nhập không hợp lệ.<br/> - Tên tài khoản phải dài ít nhất 2 ký tự.<br/> - Mật khẩu phải dài ít nhất 6 ký tự.";
      }
      if (message != "") {
        this.title = 'Xin Lưu Ý'
        this.name = 'modal-warning'
        this.message = message;
        this.modal = true;
        return;
      } else {
        this.loading = true
        axios
          .post("/api/login", this.info)
          .then(response => {
            this.loading = false
            if (
              u.is.has(response, "data") &&
              response.data["access-token"] == ""
            ) {
              this.title = 'Cảnh Báo'
              this.name = 'modal-primary'
              this.message = response.data.message;
              this.modal = true;
              return;
            } else {
              a.login(this.$router, response.data, '/dashboard')
            }
          }).catch(function(error) {
            console.log(`Login Error: ${JSON.stringify(error)}`);
        })
      }
    }
  }
};
</script>

